import Vue from 'vue'
import VueRouter from 'vue-router';
import App from './App.vue'

Vue.config.productionTip = false
Vue.use(VueRouter);

const router = new VueRouter({
  routes: [
    { path: '/', component: Home },
    { path: '/about', component: About },
    { path: '/project', component: Project},
    { path: '/contact', component: Contact},
  ],
});

new Vue({
  render: h => h(App),
  router,
}).$mount('#app')
